import React, { Component } from 'react';
import P5Wrapper from 'react-p5-wrapper';
import PianoSketch from './sketches/sketch';
import './style.css';


class Home extends Component {
  constructor(){
    super();
  }

  render() {
    return (
      <div>
        <P5Wrapper PianoSketch={PianoSketch}></P5Wrapper>
      </div>
    );
  }
}

export default Home;
